function findAll(n,t){db.DbManager.Device.findAll().then(function(i){t.render("devices",{title:"Device List",user:n.user,device:null,devices:i})})}function findById(n,t){n.params.id&&(console.log("Device Id:"+n.params.id),db.DbManager.Device.find({where:{DeviceId:n.params.id}}).then(function(i){t.render("devices",{title:"Device",user:n.params.id,device:i,devices:null})}))}function newDevices(n,t){db.DbManager.Device.findAll({where:{New:!0}}).then(function(n){n?t.send({devices:n,error:null}):t.send({error:"No devices found"})})}var db=require("../DbManager");exports.findAll=findAll,exports.findById=findById,exports.newDevices=newDevices